import React from 'react';
import { Link } from 'react-router-dom';
import { FaHome, FaUser, FaSignInAlt, FaUserPlus, FaHeart, FaHistory } from 'react-icons/fa';

function Navbar() {
  return (
    <nav className="navbar">
      <Link to="/" className="nav-link">
        <FaHome size={24} /> {/* Logo/Home */}
      </Link>

      <Link to="/favorites" className="nav-link">
        <FaHeart size={24} /> {/* Favorites */}
      </Link>

      <Link to="/history" className="nav-link">
        <FaHistory size={24} /> {/* History */}
      </Link>

      <Link to="/profile" className="nav-link">
        <FaUser size={24} /> {/* Profile */}
      </Link>

      <Link to="/login" className="nav-link">
        <FaSignInAlt size={24} />
      </Link>

      <Link to="/signup" className="nav-link">
        <FaUserPlus size={24} /> {/* Signup */}
      </Link>
    </nav>
  );
}

export default Navbar;
